// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "../authority/Member.sol";
import "../libraries/NftLibrary.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title Fighter Z Token - ERC721
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract Fighter is Member, ERC721 {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    NftLibrary.RecordStruct public _record;

    mapping (uint8 => RateStruct) private _reward_rates;
    mapping (address => NftLibrary.UserStruct) public _usr;
    mapping (address => EnumerableSet.UintSet) private _tokens;

    struct RateStruct { uint16 number; uint16 rate; uint8 times; }
    event Claim(uint256 reward, uint256 power, uint256 total_power);

    constructor(address auth_) Member(auth_)
        ERC721("Fighter Z", "DBNFT") {

        _record.reward = 1e26;

        _reward_rates[0] = RateStruct({number: 7,  rate: 35, times: 7});
        _reward_rates[1] = RateStruct({number: 3,  rate: 10, times: 1});
        _reward_rates[2] = RateStruct({number: 5,  rate: 5,  times: 1});
        _reward_rates[3] = RateStruct({number: 10, rate: 1,  times: 1});
        _reward_rates[4] = RateStruct({number: 0,  rate: 0,  times: 0});
    }

    function _doBurn(
        address account_, uint8 quality_, uint104 tokenId_
    ) private {
        _record.powers = _record.powers - quality_;
        _usr[account_].powers = _usr[account_].powers - quality_;

        _burn(tokenId_);
        _tokens[account_].remove(tokenId_);
    }

    function _getSecondReward() private view returns (uint256 sr) {
        sr = _record.reward.div(365);
        sr = sr.div(24).div(60).div(60);
    }

    function getRateStruct(uint8 quality_) public view
        returns (RateStruct memory rs) {

        rs = _reward_rates[quality_];
    }

    function getUserStruct(address account_) public view
        returns (NftLibrary.UserStruct memory us) {

        us = _usr[account_];
    }

    function getUserTokens(address account_, uint256 i)
        public view returns (uint256 tokenId) {

        tokenId = _tokens[account_].at(i);
    }

    function setExchangeRate(
        uint8 quality_, uint16 number_, uint16 rate_, uint8 times_
    ) public CheckPermit("CONFIG") {
        _reward_rates[quality_] = RateStruct({
            number: number_, rate: rate_, times: times_
        });
    }

    function transferFrom(
        address from_, address to_, uint256 tokenId_
    ) public virtual override {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId_),
            "ERC721: transfer caller is not owner nor approved"
        );

        NftLibrary.DetailStruct memory cs;
        cs = NftLibrary.tRight(uint104(tokenId_));

        _tokens[to_].add(tokenId_);
        _tokens[from_].remove(tokenId_);

        _usr[to_].powers = _usr[to_].powers + cs.quality;
        _usr[from_].powers = _usr[from_].powers - cs.quality;
        if (balanceOf(from_) <= 0) _usr[from_].period = 0;

        _transfer(from_, to_, tokenId_);
    }

    function buy(address to_, uint104 tokenId_) public
        CheckPermit("CARDSHOP") {

        NftLibrary.DetailStruct memory cs;
        cs = NftLibrary.tRight(tokenId_);

        _record.powers = _record.powers + cs.quality;
        _usr[to_].powers = _usr[to_].powers + cs.quality;

        if (cs.quality == 0) {
            _record.specials.push(tokenId_);
        }

        if (_usr[to_].period <= 0) {
            _usr[to_].period = block.timestamp;
        }

        _safeMint(to_, tokenId_);
        _tokens[to_].add(tokenId_);
    }

    function burn(
        address account_, uint8 quality_, uint104 tokenId_
    ) public CheckPermit("EXCHANGE") {

        _doBurn(account_, quality_, tokenId_);
    }

    function addExchange(address account_) public
        CheckPermit("EXCHANGE") {

        _usr[account_].exchange = _usr[account_].exchange + 1;
    }

    function getReward(address account_) public view CheckStatus("GETREWARD")
        returns (uint256 reward) {

        uint256 second_reward = _getSecondReward();

        uint256 power_rate = _usr[account_].powers.mul(1e8);
        power_rate = power_rate.div(_record.powers).div(1e8);
        uint256 period = block.timestamp - _usr[account_].period;

        reward = second_reward.mul(period).mul(power_rate).div(100);
    }

    function claim() public CheckStatus("CLAIM") {
        uint256 reward = getReward(msg.sender);
        require(reward > 0, "FIGHTER: The reward is zero.");

        _usr[msg.sender].period = block.timestamp;

        address sender = authority.members("FOUND");
        IERC20 token = IERC20(authority.members("TOKEN"));

        bool success = token.transferFrom(sender, msg.sender, reward);
        require(success, "FIGHTER: Reward transfer fiald.");

        emit Claim(reward, _usr[msg.sender].powers, _record.powers);
    }
}

